// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

struct pay {
    bool registered;
    uint256 balance;
}

struct bid {
    address sender;
    uint256 availableAmount;
}

struct shareholder {
    address receiver;
    uint256 amount;
}

contract Advertisement_V1 is Initializable, OwnableUpgradeable {
    uint256 public totalBalance;
    uint256 public bidCount;

    mapping(address => pay) public payAccounts; //pay account
    mapping(uint256 => bid) public bids;

    address public platformAddress;
    address public trustedService;

    modifier onlyRegistered() {
        require(payAccounts[msg.sender].registered == true);
        _;
    }

    modifier onlyTrustedService() {
        require(
            msg.sender == trustedService,
            "Only trusted service can call this function"
        );
        _;
    }

    function initialize(address _platformAddress, address _trustedService)
        public
        initializer
    {
        totalBalance = 0;
        bidCount = 0;
        platformAddress = _platformAddress;
        trustedService = _trustedService;
    }

    function register() public {
        require(
            payAccounts[msg.sender].registered == false,
            "User already registered"
        );
        pay memory Pay = pay(true, 0);
        payAccounts[msg.sender] = Pay;
    }

    function Bid(uint256 _days, uint256 _amount)
        public
        payable
        onlyRegistered
        returns (uint256)
    {
        require(msg.value == _days * _amount, "Amount is not correct!");

        totalBalance += msg.value;
        payAccounts[msg.sender].balance += msg.value;

        bid memory _bid = bid(msg.sender, msg.value);
        bidCount++;
        bids[bidCount] = _bid;
        return bidCount;
    }

    function settle(uint256 _id, shareholder[] memory _shareholders)
        public
        onlyTrustedService
    {
        require(_shareholders.length > 0, "Shareholder list cannot be empty");

        //payment
        for (uint8 i = 0; i < _shareholders.length; i++) {
            require(
                payAccounts[bids[_id].sender].balance > 0,
                "Advertiser has no balance"
            );
            require(
                _shareholders[i].receiver != address(0),
                "Invalid shareholder"
            );

            payAccounts[_shareholders[i].receiver].balance += _shareholders[i]
                .amount;
            payAccounts[bids[_id].sender].balance -= _shareholders[i].amount;
            bids[_id].availableAmount -= _shareholders[i].amount;
        }
    }

    function getBalance(address _adr)
        public
        view
        onlyRegistered
        returns (uint256)
    {
        return payAccounts[_adr].balance;
    }

    function withdrawMoney(address _withdrawer) public onlyOwner {
        require(
            payAccounts[_withdrawer].balance > 0,
            "Not enough balance for withdraw operation"
        );
        address payable to = payable(_withdrawer);
        uint256 amount = payAccounts[_withdrawer].balance;
        payAccounts[_withdrawer].balance = 0;
        totalBalance -= amount;
        to.transfer(amount);
    }
}

